import React, { Component } from 'react'

 class TargetTable extends Component {
  render() {
    return (
      <div>
        <table>
           	  <tr>
           	  	<th>Animals</th>
           	  	<th>Fruits</th>
           	  	<th>Numbers</th>
           	  	<th>Colours</th>
           	  </tr>
           	</table>
      </div>
    )
  }
}

export default DropTarget("item", spec, collect)(TargetTable);
